import React from 'react';
import styled from 'styled-components';

const CONTENT_WIDTH = '800px';
const NAV_HEIGHT = '50px';
let NAV_POSITION = '0';
let NAV_HEIGHT_PADDING = NAV_POSITION == '0' ? '50px' : '0px';
export { NAV_HEIGHT_PADDING, NAV_POSITION, NAV_HEIGHT, CONTENT_WIDTH };

interface Props {}
const UpperNav = styled.div`
  border: red solid 1px;
  height: ${NAV_HEIGHT};
  width: 100%;
  position: absolute;
  top: ${NAV_POSITION};
`;

const Container = styled.div`
  height: 100%;
  width: 100%;
  max-width: ${CONTENT_WIDTH}; /*For margins*/
  margin: auto; /*For margins*/
  display: flex;
  align-items: center;
  justify-content: space-between;
  border: green solid 1px;
  box-sizing: border-box;
`;
const Nav: React.FC<Props> = () => {
  return (
    <UpperNav>
      <Container>
        <div>nav Bar</div>
        <div>nav Bar</div>
      </Container>
    </UpperNav>
  );
};

export default Nav;
